import React, {Component} from 'react';
//bootstrap
import Button from 'react-bootstrap/Button';
//custom components
import {Navigation} from './Navigation';

class BtnDropdown extends Component { 
    
    constructor(props){
        super(props);
        //delete ce fichier la s'il n'est pas utilise dans navbar.js
    }

    nav(){
        this.props.navigate(this.props.path)
    }

    render(){
        return (
            <Button onClick={this.nav.bind(this)}>{this.props.name}</Button>
        );
    }

}

export default Navigation(BtnDropdown);
